import React from 'react';
import logo from './logo.svg';
import './App.css';



class Welcome extends React.Component {
  render() {
    return <h1> Welcome to Joel's Podcasts</h1>;
  }
}

class Conclusion extends React.Component {
  render() {
    return <h2>Give some a look</h2>;
  }
}

function App() {
  return (
    <div>
      <Welcome />
      <br></br>
      <Conclusion />
    </div>
  );
}

export default App;
